  XCircle,
  Video,
  MessageSquare,
  ChevronDown,
  Download,
  Trash2,
  Users,
} from 'lucide-react';
import api from '../api';

// Types
interface Beneficiary {
  id: number;
  name: string;
  phone?: string;
  email?: string;
}

interface Project {
  id: number;
  title: string;
  code: string;
}

interface Questionnaire {
  id: number;
  name?: string;
  title?: string;
  template?: {
    id: number;
    name: string;
  };
}

interface AIInterviewSession {
  id: string;
  access_token: string;
  beneficiary: Beneficiary;
  project: Project;
  questionnaire: Questionnaire;
  status: 'pending' | 'in_progress' | 'paused' | 'completed' | 'abandoned' | 'expired';
  language: string;
  total_questions: number;
  answered_questions: number;
  video_capture_enabled: boolean;
  video_consent_captured: boolean;
  started_at: string | null;
  completed_at: string | null;
  expires_at: string | null;
  created_at: string;
  updated_at: string;
}

interface PaginatedResponse {
  count: number;
  next: string | null;
  previous: string | null;
  results: AIInterviewSession[];
}

// Language mapping
const LANGUAGE_LABELS: Record<string, string> = {
  en: 'English',
  hi: 'Hindi',
  bn: 'Bengali',
  te: 'Telugu',
  ta: 'Tamil',
  mr: 'Marathi',
  gu: 'Gujarati',
};

// Status configuration
const STATUS_CONFIG: Record<string, { label: string; color: string; bgColor: string; icon: React.ReactNode }> = {
  pending: {
    label: 'Pending',
    color: 'text-yellow-700',
    bgColor: 'bg-yellow-100',
    icon: <Clock className="w-3.5 h-3.5" />,
  },
  in_progress: {
    label: 'In Progress',
    color: 'text-blue-700',
    bgColor: 'bg-blue-100',
    icon: <Play className="w-3.5 h-3.5" />,
  },
  paused: {
    label: 'Paused',
    color: 'text-orange-700',
    bgColor: 'bg-orange-100',
    icon: <Pause className="w-3.5 h-3.5" />,
  },
  completed: {
    label: 'Completed',
    color: 'text-green-700',
    bgColor: 'bg-green-100',
    icon: <CheckCircle className="w-3.5 h-3.5" />,
  },
  abandoned: {
    label: 'Abandoned',
    color: 'text-gray-700',
    bgColor: 'bg-gray-100',
    icon: <XCircle className="w-3.5 h-3.5" />,
  },
  expired: {
    label: 'Expired',
    color: 'text-red-700',
    bgColor: 'bg-red-100',
    icon: <AlertCircle className="w-3.5 h-3.5" />,
  },
};

const AIInterviewsManagementPage: React.FC = () => {
  // State
  const [sessions, setSessions] = useState<AIInterviewSession[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [searchQuery, setSearchQuery] = useState('');
  const [statusFilter, setStatusFilter] = useState<string>('all');
  const [projectFilter, setProjectFilter] = useState<string>('all');
  const [projects, setProjects] = useState<Project[]>([]);
  const [showCreateModal, setShowCreateModal] = useState(false);
  const [selectedSession, setSelectedSession] = useState<AIInterviewSession | null>(null);
  const [showDetailModal, setShowDetailModal] = useState(false);
  const [copiedToken, setCopiedToken] = useState<string | null>(null);

  // Stats
  const stats = {
    total: sessions.length,
    inProgress: sessions.filter((s) => s.status === 'in_progress').length,
    completed: sessions.filter((s) => s.status === 'completed').length,
    pending: sessions.filter((s) => s.status === 'pending').length,
  };

  // Fetch sessions
  const fetchSessions = useCallback(async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await api.get<PaginatedResponse | AIInterviewSession[]>('/api/ai-interviews/sessions/');
      // Handle both paginated and non-paginated responses
      const data = Array.isArray(response.data) ? response.data : response.data.results;
      setSessions(data);
    } catch (err: any) {
      console.error('Error fetching sessions:', err);
      setError(err.response?.data?.detail || 'Failed to load interview sessions');
    } finally {
      setLoading(false);
    }
  }, []);

  // Fetch projects for filter
  const fetchProjects = useCallback(async () => {
    try {
      const response = await api.get('/api/projects/');
      const data = Array.isArray(response.data) ? response.data : response.data.results || [];
      setProjects(data);
    } catch (err) {
      console.error('Error fetching projects:', err);
    }
  }, []);

  useEffect(() => {
    fetchSessions();
    fetchProjects();
  }, [fetchSessions, fetchProjects]);

  // Filter sessions
  const filteredSessions = sessions.filter((session) => {
    // Search filter
    const searchLower = searchQuery.toLowerCase();
    const matchesSearch =
      !searchQuery ||
      session.beneficiary?.name?.toLowerCase().includes(searchLower) ||
      session.beneficiary?.phone?.includes(searchQuery) ||
      session.project?.title?.toLowerCase().includes(searchLower) ||
      session.project?.code?.toLowerCase().includes(searchLower);

    // Status filter
    const matchesStatus = statusFilter === 'all' || session.status === statusFilter;

    // Project filter
    const matchesProject = projectFilter === 'all' || session.project?.id?.toString() === projectFilter;

    return matchesSearch && matchesStatus && matchesProject;
  });

  // Copy interview link
  const copyInterviewLink = async (token: string) => {
    const link = `${window.location.origin}/ai-interview/${token}`;
    try {
      await navigator.clipboard.writeText(link);
      setCopiedToken(token);
      setTimeout(() => setCopiedToken(null), 2000);
    } catch (err) {
      console.error('Failed to copy:', err);
    }
  };

  // Open interview in new tab
  const openInterview = (token: string) => {
    window.open(`/ai-interview/${token}`, '_blank');
  };

  // View session details
  const viewSessionDetails = (session: AIInterviewSession) => {
    setSelectedSession(session);
    setShowDetailModal(true);
  };

  // Format date
  const formatDate = (dateStr: string | null) => {
    if (!dateStr) return '-';
    return new Date(dateStr).toLocaleDateString('en-US', {
      month: 'short',
      day: 'numeric',
      year: 'numeric',
    });
  };

  // Format date with time
  const formatDateTime = (dateStr: string | null) => {
    if (!dateStr) return '-';
    return new Date(dateStr).toLocaleString('en-US', {
      month: 'short',
      day: 'numeric',
      year: 'numeric',
      hour: 'numeric',
      minute: '2-digit',
    });
  };

  // Get progress percentage
  const getProgressPercentage = (session: AIInterviewSession) => {
    if (!session.total_questions || session.total_questions === 0) return 0;
    return Math.round((session.answered_questions / session.total_questions) * 100);
  };

  // Get language label
  const getLanguageLabel = (langCode: string) => {
    return LANGUAGE_LABELS[langCode] || langCode?.toUpperCase() || '-';
  };

  // Render status badge
  const renderStatusBadge = (status: string) => {
    const config = STATUS_CONFIG[status] || STATUS_CONFIG.pending;
    return (
      <span
        className={`inline-flex items-center gap-1.5 px-2.5 py-1 rounded-full text-xs font-medium ${config.bgColor} ${config.color}`}
      >
        {config.icon}
        {config.label}
      </span>
    );
  };

  // Render progress bar
  const renderProgressBar = (session: AIInterviewSession) => {
    const percentage = getProgressPercentage(session);
    const answered = session.answered_questions || 0;
    const total = session.total_questions || 0;

    return (
      <div className="flex items-center gap-2">
        <div className="flex-1 h-2 bg-gray-200 rounded-full overflow-hidden min-w-[80px]">
          <div
            className={`h-full rounded-full transition-all ${
              percentage === 100 ? 'bg-green-500' : percentage > 0 ? 'bg-blue-500' : 'bg-gray-300'
            }`}
            style={{ width: `${percentage}%` }}
          />
        </div>
        <span className="text-sm text-gray-600 whitespace-nowrap">
          {answered}/{total}
        </span>
      </div>
    );
  };

  return (
    <div className="p-6 bg-gray-50 min-h-screen">
      {/* Header */}
      <div className="flex items-center justify-between mb-6">
        <div className="flex items-center gap-3">
          <div className="p-2 bg-green-100 rounded-lg">
            <MessageSquare className="w-6 h-6 text-green-600" />
          </div>
          <div>
            <h1 className="text-2xl font-bold text-gray-900">AI Voice Interviews</h1>
            <p className="text-sm text-gray-500">Manage AI-powered voice interviews for beneficiaries</p>
          </div>
        </div>
        <button
          onClick={() => setShowCreateModal(true)}
          className="flex items-center gap-2 px-4 py-2 bg-green-600 text-white rounded-lg hover:bg-green-700 transition-colors"
        >
          <Plus className="w-4 h-4" />
          Create Sessions
        </button>
      </div>

      {/* Stats Cards */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-4 mb-6">
        <div className="bg-white rounded-xl p-4 shadow-sm border border-gray-100">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-500">Total Sessions</p>
              <p className="text-2xl font-bold text-gray-900">{stats.total}</p>
            </div>
            <div className="p-3 bg-gray-100 rounded-lg">
              <Users className="w-5 h-5 text-gray-600" />
            </div>
          </div>
        </div>

        <div className="bg-white rounded-xl p-4 shadow-sm border border-gray-100">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-500">In Progress</p>
              <p className="text-2xl font-bold text-blue-600">{stats.inProgress}</p>
            </div>
            <div className="p-3 bg-blue-100 rounded-lg">
              <Play className="w-5 h-5 text-blue-600" />
            </div>
          </div>
        </div>

        <div className="bg-white rounded-xl p-4 shadow-sm border border-gray-100">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-500">Completed</p>
              <p className="text-2xl font-bold text-green-600">{stats.completed}</p>
            </div>
            <div className="p-3 bg-green-100 rounded-lg">
              <CheckCircle className="w-5 h-5 text-green-600" />
            </div>
          </div>
        </div>

        <div className="bg-white rounded-xl p-4 shadow-sm border border-gray-100">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-sm text-gray-500">Pending</p>
              <p className="text-2xl font-bold text-yellow-600">{stats.pending}</p>
            </div>
            <div className="p-3 bg-yellow-100 rounded-lg">
              <Clock className="w-5 h-5 text-yellow-600" />
            </div>
          </div>
        </div>
      </div>

      {/* Filters */}
      <div className="bg-white rounded-xl shadow-sm border border-gray-100 mb-6">
        <div className="p-4 flex flex-wrap items-center gap-4">
          {/* Search */}
          <div className="relative flex-1 min-w-[250px]">
            <Search className="absolute left-3 top-1/2 -translate-y-1/2 w-4 h-4 text-gray-400" />
            <input
              type="text"
              placeholder="Search by beneficiary or project..."
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              className="w-full pl-10 pr-4 py-2 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500 focus:border-transparent"
            />
          </div>

          {/* Status Filter */}
          <div className="relative">
            <select
              value={statusFilter}
              onChange={(e) => setStatusFilter(e.target.value)}
              className="appearance-none pl-4 pr-10 py-2 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500 bg-white cursor-pointer"
            >
              <option value="all">All Statuses</option>
              <option value="pending">Pending</option>
              <option value="in_progress">In Progress</option>
              <option value="paused">Paused</option>
              <option value="completed">Completed</option>
              <option value="abandoned">Abandoned</option>
              <option value="expired">Expired</option>
            </select>
            <ChevronDown className="absolute right-3 top-1/2 -translate-y-1/2 w-4 h-4 text-gray-400 pointer-events-none" />
          </div>

          {/* Project Filter */}
          <div className="relative">
            <select
              value={projectFilter}
              onChange={(e) => setProjectFilter(e.target.value)}
              className="appearance-none pl-4 pr-10 py-2 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500 bg-white cursor-pointer"
            >
              <option value="all">All Projects</option>
              {projects.map((project) => (
                <option key={project.id} value={project.id.toString()}>
                  {project.code} - {project.title}
                </option>
              ))}
            </select>
            <ChevronDown className="absolute right-3 top-1/2 -translate-y-1/2 w-4 h-4 text-gray-400 pointer-events-none" />
          </div>

          {/* Refresh */}
          <button
            onClick={fetchSessions}
            disabled={loading}
            className="flex items-center gap-2 px-4 py-2 text-gray-600 hover:bg-gray-100 rounded-lg transition-colors"
          >
            <RefreshCw className={`w-4 h-4 ${loading ? 'animate-spin' : ''}`} />
            Refresh
          </button>
        </div>
      </div>

      {/* Error State */}
      {error && (
        <div className="bg-red-50 border border-red-200 rounded-lg p-4 mb-6">
          <div className="flex items-center gap-2 text-red-700">
            <AlertCircle className="w-5 h-5" />
            <span>{error}</span>
          </div>
        </div>
      )}

      {/* Sessions Table */}
      <div className="bg-white rounded-xl shadow-sm border border-gray-100 overflow-hidden">
        {loading ? (
          <div className="p-8 text-center">
            <RefreshCw className="w-8 h-8 animate-spin text-green-600 mx-auto mb-2" />
            <p className="text-gray-500">Loading sessions...</p>
          </div>
        ) : filteredSessions.length === 0 ? (
          <div className="p-8 text-center">
            <MessageSquare className="w-12 h-12 text-gray-300 mx-auto mb-3" />
            <p className="text-gray-500 mb-1">No interview sessions found</p>
            <p className="text-sm text-gray-400">
              {searchQuery || statusFilter !== 'all' || projectFilter !== 'all'
                ? 'Try adjusting your filters'
                : 'Create sessions to get started'}
            </p>
          </div>
        ) : (
          <div className="overflow-x-auto">
            <table className="w-full">
              <thead className="bg-gray-50 border-b border-gray-100">
                <tr>
                  <th className="text-left px-4 py-3 text-xs font-semibold text-gray-500 uppercase tracking-wider">
                    Beneficiary
                  </th>
                  <th className="text-left px-4 py-3 text-xs font-semibold text-gray-500 uppercase tracking-wider">
                    Project
                  </th>
                  <th className="text-left px-4 py-3 text-xs font-semibold text-gray-500 uppercase tracking-wider">
                    Status
                  </th>
                  <th className="text-left px-4 py-3 text-xs font-semibold text-gray-500 uppercase tracking-wider">
                    Progress
                  </th>
                  <th className="text-left px-4 py-3 text-xs font-semibold text-gray-500 uppercase tracking-wider">
                    Language
                  </th>
                  <th className="text-left px-4 py-3 text-xs font-semibold text-gray-500 uppercase tracking-wider">
                    Created
                  </th>
                  <th className="text-left px-4 py-3 text-xs font-semibold text-gray-500 uppercase tracking-wider">
                    Actions
                  </th>
                </tr>
              </thead>
              <tbody className="divide-y divide-gray-100">
                {filteredSessions.map((session) => (
                  <tr key={session.id} className="hover:bg-gray-50 transition-colors">
                    {/* Beneficiary */}
                    <td className="px-4 py-3">
                      <div>
                        <p className="font-medium text-gray-900">{session.beneficiary?.name || 'Unknown'}</p>
                        <p className="text-sm text-gray-500">{session.beneficiary?.phone || '-'}</p>
                      </div>
                    </td>

                    {/* Project */}
                    <td className="px-4 py-3">
                      <div>
                        <p className="font-medium text-gray-900">{session.project?.code || '-'}</p>
                        <p className="text-sm text-gray-500 truncate max-w-[200px]">
                          {session.questionnaire?.title ||
                            session.questionnaire?.name ||
                            session.questionnaire?.template?.name ||
                            'Assessment'}
                        </p>
                      </div>
                    </td>

                    {/* Status */}
                    <td className="px-4 py-3">{renderStatusBadge(session.status)}</td>

                    {/* Progress */}
                    <td className="px-4 py-3 min-w-[150px]">{renderProgressBar(session)}</td>

                    {/* Language */}
                    <td className="px-4 py-3">
                      <span className="inline-flex items-center px-2.5 py-1 rounded-full text-xs font-medium bg-purple-100 text-purple-700">
                        {getLanguageLabel(session.language)}
                      </span>
                    </td>

                    {/* Created */}
                    <td className="px-4 py-3 text-sm text-gray-600">{formatDate(session.created_at)}</td>

                    {/* Actions */}
                    <td className="px-4 py-3">
                      <div className="flex items-center gap-1">
                        <button
                          onClick={() => viewSessionDetails(session)}
                          className="p-2 text-gray-400 hover:text-gray-600 hover:bg-gray-100 rounded-lg transition-colors"
                          title="View Details"
                        >
                          <Eye className="w-4 h-4" />
                        </button>
                        <button
                          onClick={() => copyInterviewLink(session.access_token)}
                          className="p-2 text-gray-400 hover:text-gray-600 hover:bg-gray-100 rounded-lg transition-colors"
                          title={copiedToken === session.access_token ? 'Copied!' : 'Copy Link'}
                        >
                          <Copy className={`w-4 h-4 ${copiedToken === session.access_token ? 'text-green-600' : ''}`} />
                        </button>
                        <button
                          onClick={() => openInterview(session.access_token)}
                          className="p-2 text-gray-400 hover:text-gray-600 hover:bg-gray-100 rounded-lg transition-colors"
                          title="Open Interview"
                        >
                          <ExternalLink className="w-4 h-4" />
                        </button>
                        {session.video_capture_enabled && (
                          <button
                            className="p-2 text-gray-400 hover:text-gray-600 hover:bg-gray-100 rounded-lg transition-colors"
                            title="View Videos"
                          >
                            <Video className="w-4 h-4" />
                          </button>
                        )}
                      </div>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>

      {/* Session Detail Modal */}
      {showDetailModal && selectedSession && (
        <div className="fixed inset-0 bg-black/50 flex items-center justify-center z-50 p-4">
          <div className="bg-white rounded-xl max-w-2xl w-full max-h-[90vh] overflow-y-auto">
            <div className="p-6 border-b border-gray-100">
              <div className="flex items-center justify-between">
                <h2 className="text-xl font-bold text-gray-900">Session Details</h2>
                <button
                  onClick={() => setShowDetailModal(false)}
                  className="p-2 text-gray-400 hover:text-gray-600 rounded-lg"
                >
                  <XCircle className="w-5 h-5" />
                </button>
              </div>
            </div>

            <div className="p-6 space-y-6">
              {/* Beneficiary Info */}
              <div>
                <h3 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">Beneficiary</h3>
                <div className="bg-gray-50 rounded-lg p-4">
                  <p className="font-medium text-gray-900">{selectedSession.beneficiary?.name}</p>
                  <p className="text-sm text-gray-500">{selectedSession.beneficiary?.phone}</p>
                  {selectedSession.beneficiary?.email && (
                    <p className="text-sm text-gray-500">{selectedSession.beneficiary?.email}</p>
                  )}
                </div>
              </div>

              {/* Project Info */}
              <div>
                <h3 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">Project</h3>
                <div className="bg-gray-50 rounded-lg p-4">
                  <p className="font-medium text-gray-900">
                    {selectedSession.project?.code} - {selectedSession.project?.title}
                  </p>
                  <p className="text-sm text-gray-500">
                    {selectedSession.questionnaire?.title ||
                      selectedSession.questionnaire?.name ||
                      selectedSession.questionnaire?.template?.name}
                  </p>
                </div>
              </div>

              {/* Status & Progress */}
              <div className="grid grid-cols-2 gap-4">
                <div>
                  <h3 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">Status</h3>
                  <div>{renderStatusBadge(selectedSession.status)}</div>
                </div>
                <div>
                  <h3 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">Language</h3>
                  <span className="inline-flex items-center px-2.5 py-1 rounded-full text-xs font-medium bg-purple-100 text-purple-700">
                    {getLanguageLabel(selectedSession.language)}
                  </span>
                </div>
              </div>

              {/* Progress */}
              <div>
                <h3 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">Progress</h3>
                <div className="bg-gray-50 rounded-lg p-4">
                  {renderProgressBar(selectedSession)}
                  <p className="text-sm text-gray-500 mt-2">
                    {selectedSession.answered_questions} of {selectedSession.total_questions} questions answered (
                    {getProgressPercentage(selectedSession)}%)
                  </p>
                </div>
              </div>

              {/* Video Settings */}
              <div>
                <h3 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">Video Settings</h3>
                <div className="bg-gray-50 rounded-lg p-4 space-y-2">
                  <div className="flex items-center justify-between">
                    <span className="text-gray-600">Video Capture</span>
                    <span
                      className={`font-medium ${selectedSession.video_capture_enabled ? 'text-green-600' : 'text-gray-400'}`}
                    >
                      {selectedSession.video_capture_enabled ? 'Enabled' : 'Disabled'}
                    </span>
                  </div>
                  <div className="flex items-center justify-between">
                    <span className="text-gray-600">Consent Captured</span>
                    <span
                      className={`font-medium ${selectedSession.video_consent_captured ? 'text-green-600' : 'text-gray-400'}`}
                    >
                      {selectedSession.video_consent_captured ? 'Yes' : 'No'}
                    </span>
                  </div>
                </div>
              </div>

              {/* Timestamps */}
              <div>
                <h3 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">Timeline</h3>
                <div className="bg-gray-50 rounded-lg p-4 space-y-2">
                  <div className="flex items-center justify-between">
                    <span className="text-gray-600">Created</span>
                    <span className="font-medium text-gray-900">{formatDateTime(selectedSession.created_at)}</span>
                  </div>
                  <div className="flex items-center justify-between">
                    <span className="text-gray-600">Started</span>
                    <span className="font-medium text-gray-900">{formatDateTime(selectedSession.started_at)}</span>
                  </div>
                  <div className="flex items-center justify-between">
                    <span className="text-gray-600">Completed</span>
                    <span className="font-medium text-gray-900">{formatDateTime(selectedSession.completed_at)}</span>
                  </div>
                  <div className="flex items-center justify-between">
                    <span className="text-gray-600">Expires</span>
                    <span className="font-medium text-gray-900">{formatDateTime(selectedSession.expires_at)}</span>
                  </div>
                </div>
              </div>

              {/* Access Token */}
              <div>
                <h3 className="text-sm font-semibold text-gray-500 uppercase tracking-wider mb-3">Interview Link</h3>
                <div className="bg-gray-50 rounded-lg p-4">
                  <div className="flex items-center gap-2">
                    <code className="flex-1 text-sm text-gray-600 break-all">
                      {window.location.origin}/ai-interview/{selectedSession.access_token}
                    </code>
                    <button
                      onClick={() => copyInterviewLink(selectedSession.access_token)}
                      className="p-2 text-gray-400 hover:text-gray-600 rounded-lg"
                    >
                      <Copy className="w-4 h-4" />
                    </button>
                    <button
                      onClick={() => openInterview(selectedSession.access_token)}
                      className="p-2 text-gray-400 hover:text-gray-600 rounded-lg"
                    >
                      <ExternalLink className="w-4 h-4" />
                    </button>
                  </div>
                </div>
              </div>
            </div>

            <div className="p-6 border-t border-gray-100 flex justify-end gap-3">
              <button
                onClick={() => setShowDetailModal(false)}
                className="px-4 py-2 text-gray-600 hover:bg-gray-100 rounded-lg transition-colors"
              >
                Close
              </button>
              <button
                onClick={() => openInterview(selectedSession.access_token)}
                className="flex items-center gap-2 px-4 py-2 bg-green-600 text-white rounded-lg hover:bg-green-700 transition-colors"
              >
                <ExternalLink className="w-4 h-4" />
                Open Interview
              </button>
            </div>
          </div>
        </div>
      )}

      {/* Create Sessions Modal */}
      {showCreateModal && (
        <CreateSessionsModal
          onClose={() => setShowCreateModal(false)}
          onSuccess={() => {
            setShowCreateModal(false);
            fetchSessions();
          }}
          projects={projects}
        />
      )}
    </div>
  );
};

// Create Sessions Modal Component
interface CreateSessionsModalProps {
  onClose: () => void;
  onSuccess: () => void;
  projects: Project[];
}

const CreateSessionsModal: React.FC<CreateSessionsModalProps> = ({ onClose, onSuccess, projects }) => {
  const [selectedProject, setSelectedProject] = useState<string>('');
  const [selectedQuestionnaire, setSelectedQuestionnaire] = useState<string>('');
  const [selectedLanguage, setSelectedLanguage] = useState<string>('en');
  const [selectedBeneficiaries, setSelectedBeneficiaries] = useState<number[]>([]);
  const [questionnaires, setQuestionnaires] = useState<any[]>([]);
  const [beneficiaries, setBeneficiaries] = useState<Beneficiary[]>([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  // Fetch questionnaires when project changes
  useEffect(() => {
    if (selectedProject) {
      fetchQuestionnaires();
      fetchBeneficiaries();
    }
  }, [selectedProject]);

  const fetchQuestionnaires = async () => {
    try {
      const response = await api.get(`/api/questionnaires/project-questionnaires/?project=${selectedProject}`);
      const data = Array.isArray(response.data) ? response.data : response.data.results || [];
      setQuestionnaires(data);
    } catch (err) {
      console.error('Error fetching questionnaires:', err);
    }
  };

  const fetchBeneficiaries = async () => {
    try {
      const response = await api.get(`/api/beneficiaries/?project=${selectedProject}`);
      const data = Array.isArray(response.data) ? response.data : response.data.results || [];
      setBeneficiaries(data);
    } catch (err) {
      console.error('Error fetching beneficiaries:', err);
    }
  };

  const handleCreate = async () => {
    if (!selectedProject || !selectedQuestionnaire || selectedBeneficiaries.length === 0) {
      setError('Please select a project, questionnaire, and at least one beneficiary');
      return;
    }

    setLoading(true);
    setError(null);

    try {
      await api.post('/api/ai-interviews/sessions/bulk_create/', {
        project: parseInt(selectedProject),
        questionnaire: parseInt(selectedQuestionnaire),
        beneficiary_ids: selectedBeneficiaries,
        language: selectedLanguage,
      });
      onSuccess();
    } catch (err: any) {
      setError(err.response?.data?.detail || 'Failed to create sessions');
    } finally {
      setLoading(false);
    }
  };

  const toggleBeneficiary = (id: number) => {
    setSelectedBeneficiaries((prev) => (prev.includes(id) ? prev.filter((b) => b !== id) : [...prev, id]));
  };

  const selectAllBeneficiaries = () => {
    if (selectedBeneficiaries.length === beneficiaries.length) {
      setSelectedBeneficiaries([]);
    } else {
      setSelectedBeneficiaries(beneficiaries.map((b) => b.id));
    }
  };

  return (
    <div className="fixed inset-0 bg-black/50 flex items-center justify-center z-50 p-4">
      <div className="bg-white rounded-xl max-w-2xl w-full max-h-[90vh] overflow-y-auto">
        <div className="p-6 border-b border-gray-100">
          <div className="flex items-center justify-between">
            <h2 className="text-xl font-bold text-gray-900">Create Interview Sessions</h2>
            <button onClick={onClose} className="p-2 text-gray-400 hover:text-gray-600 rounded-lg">
              <XCircle className="w-5 h-5" />
            </button>
          </div>
        </div>

        <div className="p-6 space-y-6">
          {error && (
            <div className="bg-red-50 border border-red-200 rounded-lg p-4">
              <div className="flex items-center gap-2 text-red-700">
                <AlertCircle className="w-5 h-5" />
                <span>{error}</span>
              </div>
            </div>
          )}

          {/* Project Selection */}
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">Project</label>
            <select
              value={selectedProject}
              onChange={(e) => setSelectedProject(e.target.value)}
              className="w-full px-4 py-2 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
            >
              <option value="">Select a project</option>
              {projects.map((project) => (
                <option key={project.id} value={project.id.toString()}>
                  {project.code} - {project.title}
                </option>
              ))}
            </select>
          </div>

          {/* Questionnaire Selection */}
          {selectedProject && (
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">Questionnaire</label>
              <select
                value={selectedQuestionnaire}
                onChange={(e) => setSelectedQuestionnaire(e.target.value)}
                className="w-full px-4 py-2 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
              >
                <option value="">Select a questionnaire</option>
                {questionnaires.map((q) => (
                  <option key={q.id} value={q.id.toString()}>
                    {q.name || q.title || q.template?.name || `Questionnaire ${q.id}`}
                  </option>
                ))}
              </select>
            </div>
          )}

          {/* Language Selection */}
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">Language</label>
            <select
              value={selectedLanguage}
              onChange={(e) => setSelectedLanguage(e.target.value)}
              className="w-full px-4 py-2 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-green-500"
            >
              {Object.entries(LANGUAGE_LABELS).map(([code, label]) => (
                <option key={code} value={code}>
                  {label}
                </option>
              ))}
            </select>
          </div>

          {/* Beneficiaries Selection */}
          {selectedProject && (
            <div>
              <div className="flex items-center justify-between mb-2">
                <label className="block text-sm font-medium text-gray-700">
                  Beneficiaries ({selectedBeneficiaries.length} selected)
                </label>
                <button onClick={selectAllBeneficiaries} className="text-sm text-green-600 hover:text-green-700">
                  {selectedBeneficiaries.length === beneficiaries.length ? 'Deselect All' : 'Select All'}
                </button>
              </div>
              <div className="border border-gray-200 rounded-lg max-h-60 overflow-y-auto">
                {beneficiaries.length === 0 ? (
                  <div className="p-4 text-center text-gray-500">No beneficiaries found for this project</div>
                ) : (
                  beneficiaries.map((beneficiary) => (
                    <label
                      key={beneficiary.id}
                      className="flex items-center gap-3 p-3 hover:bg-gray-50 cursor-pointer border-b border-gray-100 last:border-b-0"
                    >
                      <input
                        type="checkbox"
                        checked={selectedBeneficiaries.includes(beneficiary.id)}
                        onChange={() => toggleBeneficiary(beneficiary.id)}
                        className="w-4 h-4 text-green-600 rounded focus:ring-green-500"
                      />
                      <div>
                        <p className="font-medium text-gray-900">{beneficiary.name}</p>
                        <p className="text-sm text-gray-500">{beneficiary.phone}</p>
                      </div>
                    </label>
                  ))
                )}
              </div>
            </div>
          )}
        </div>

        <div className="p-6 border-t border-gray-100 flex justify-end gap-3">
          <button
            onClick={onClose}
            className="px-4 py-2 text-gray-600 hover:bg-gray-100 rounded-lg transition-colors"
          >
            Cancel
          </button>
          <button
            onClick={handleCreate}
            disabled={loading || !selectedProject || !selectedQuestionnaire || selectedBeneficiaries.length === 0}
            className="flex items-center gap-2 px-4 py-2 bg-green-600 text-white rounded-lg hover:bg-green-700 transition-colors disabled:opacity-50 disabled:cursor-not-allowed"
          >
            {loading ? (
              <>
                <RefreshCw className="w-4 h-4 animate-spin" />
                Creating...
              </>
            ) : (
              <>
                <Plus className="w-4 h-4" />
                Create {selectedBeneficiaries.length} Session{selectedBeneficiaries.length !== 1 ? 's' : ''}
              </>
            )}
          </button>
        </div>
      </div>
    </div>
  );
};

export default AIInterviewsManagementPage;
